function init(id, nums){
  var main = document.getElementById(id);
  for(var deSo = 1; deSo <= nums ; deSo++){
    var de = document.createElement("option");
    if(deSo < 10) de.value = "0" + deSo; else de.value = deSo;
    de.text = deSo;
    main.add(de, null);
  }
}
